    "2016-02-26T22:03:45.150227",nt"name": "intelligent-systems",nt"isopen":
    true,nt"url": null,nt"notes": "The autonomous systems (AS) project, led
    by NASA Ames, is developing software for system operation automation. AS technology
    will help astronauts make more decisions without the assistance of people on the
    ground, providing software for automatic diagnosis of failures in a spacecraft of
    other system, and software to automate the execution of sequences of actions at
    the discretion of human operators. In June, AS software increased coordination capability
    while decreasing workload under varying operational scenarios, time delays, and
    levels of crew autonomy during the autonomous mission operations experiment in the
    Deep Space Habitat at Johnson.",nt"license_title": "U.S. Government Work",nt"extras":
